(57731, 'deDE', 'Zinnzischelixs tragbare Schreddereinheit', 'Meisteringenieur Zinnzischelix möchte, dass Ihr ihm Folgendes bringt:$B$B*30 Thoriumbarren.$B$B*50 Mithrilbarren.$B$B*75 Eisenbarren.$B$B*1 Dampfsäge.', 'Ich bin ebenso begierig wie Ihr darauf, meine tragbare Schreddereinheit auszuprobieren, $R, aber bevor ich das Set herstellen kann, benötige ich Material - viel Material!$B$BUm genau zu sein, benötige ich einen Berg aus Thorium, Mithril und Eisen. Ich benötige außerdem eine Dampfsäge pro Einheit. Diese müsst Ihr beim Sägewerk beschaffen.$B$BAls ich mich hier umgesehen habe (vor meiner Gefangennahme), ist mir ein Stapel Dampfsägen im Holzlager der Sturmlanzen aufgefallen.', '', '', '', '', '', '', 32750),
(57730, 'deDE', 'Zinnzischelixs tragbare Schreddereinheit', 'Meisteringenieur Zinnzischelix möchte, dass Ihr ihm Folgendes bringt:$B$B*30 Thoriumbarren.$B$B*50 Mithrilbarren.$B$B*75 Eisenbarren.$B$B*1 Dampfsäge.', 'Ich bin ebenso begierig wie Ihr darauf, meine tragbare Schreddereinheit auszuprobieren, $R, aber bevor ich das Set herstellen kann, benötige ich Material - viel Material!$B$BUm genau zu sein, benötige ich einen Berg aus Thorium, Mithril und Eisen. Ich benötige außerdem eine Dampfsäge pro Einheit. Diese müsst Ihr beim Sägewerk beschaffen.$B$BAls ich mich hier umgesehen habe (vor meiner Gefangennahme), ist mir ein Stapel Dampfsägen im Holzlager der Frostwölfe aufgefallen.', '', '', '', '', '', '', 32750),
(57723, 'deDE', 'Verwaiste Ställe', 'Findet einen Frostwolf im Alteractal. Wenn Ihr Euch in der Nähe eines Frostwolfs befindet, benutzt den Frostwolfmaulkorb, um das Tier einzufangen. Nach erfolgreicher Zähmung folgt Euch der Frostwolf bis zur Stallmeisterin zurück. Sprecht mit der Stallmeisterin, um für Euren Fang belohnt zu werden.', 'Der Krieg hier im Tal hat viele Opfer gefordert. Unsere Streitkräfte müssen dringend wieder aufgebaut werden!$B$BWenn wir es schaffen, unsere Ställe wieder zu füllen, können unsere glorreichen Wolfsreiter wieder in die Schlacht reiten.$B$BNehmt diesen Maulkorb und begebt Euch in die nahegelegenen Wälder. Sucht in der Umgebung nach herumstreifenden Frostwölfen und fangt sie mit dem Maulkorb ein. Wenn Ihr einen Wolf gezähmt habt, bringt ihn zu mir und ich werde ihn in unseren Ställen unterbringen.$B$BSobald wir wieder über ausreichend Wölfe verfügen, werden die Wolfsreiter ihre Frontpatrouillen fortsetzen.', 'Frostwolf gezähmt und zurückgebracht', '', '', '', '', 'Kehrt zur Stallmeisterin der Frostwölfe im Alteractal zurück.', 32750),
(57722, 'deDE', 'Verwaiste Ställe', 'Findet einen Alteracwidder im Alteractal. Wenn Ihr Euch in der Nähe eines Alteracwidders befindet, benutzt das Zähmungshalsband der Sturmlanzen, um das Tier einzufangen. Nach erfolgreicher Zähmung folgt Euch der Alteracwidder bis zum Stallmeister zurück. Sprecht mit dem Stallmeister, um für Euren Fang belohnt zu werden.', 'Seht Euch nur unsere Ställe an, $n! Völlig leer! Die Sturmlanzengarde hat keine Widder mehr, die sie reiten könnte, die Kavallerie ist praktisch nicht mehr existent.$B$BIhr müsst uns helfen, Soldat. Nehmt dieses Zähmungshalsband und begebt Euch in die Wildnis dieses Tals. Sucht in der Umgebung nach herumstreifenden Alteracwiddern und fangt sie mit dem Zähmungshalsband ein. Wenn Ihr einen Widder eingefangen habt, bringt ihn zu mir und ich werde ihn in unseren Ställen unterbringen. Sobald wir wieder über ausreichend Widder verfügen, werde ich den Kommandanten der Widderreiter informieren.$B$BMit Eurer Hilfe wird die Kavallerie neu entstehen!', 'Widder eingefangen und zurückgebracht', '', '', '', '', 'Kehrt zur Stallmeisterin der Sturmlanzen in Dun Baldar im Alteractal zurück.', 32750),
(57686, 'deDE', 'Der Ewige Reisende', 'Sammelt Echos der Sterblichkeit von lebenden Kreaturen.', 'Grüße, $gSterblicher:Sterbliche;.\n\nSeit ewigen Zeiten reist unseresgleichen durch die unzähligen Welten der Wirklichkeit. Wir haben Dinge gesehen, die Ihr niemals begreifen würdet. Und doch müsst Ihr viel lernen über das, was Euch jenseits des Horizonts erwartet.\n\nDer Tod gewinnt immer mehr an Macht. Der Schleier zwischen Eurer Welt und den Schattenlanden wird dünner und dünner.\n\nVergeht ein sterbliches Leben, so bleibt ein Echo zurück. Die mächtigsten Sterblichen hinterlassen die klangvollsten Echos.\n\nBringt sie zu mir, damit ich sie untersuchen kann... zu unserem beiderseitigen Nutzen.', '', '', '', '', '', '', 32750),
(57670, 'deDE', 'Unglaubliche Qualität', 'Bringt den gesammelten Flutblütenhonig zu Bert der Miesmuschel in Brennadam.', '<Jetzt wo Euer Ernter ausgereift ist, produziert der Honigrückenschwarm zusätzlichen Honig.\n\nJemand in Brennadam hätte dafür sicher Verwendung.>', '', '', '', '', '', 'Bringt den gesammelten Flutblütenhonig zu Bert der Miesmuschel in Brennadam.', 32750),
(57643, 'deDE', 'Ein leicht geschütteltes Geschenk', '', '', '', '', '', '', '', '', 32750),
(57642, 'deDE', 'Ein Winterhauchgeschenk', '', '', '', '', '', '', '', '', 32750),
(57641, 'deDE', 'Meister Rysons allsehendes Auge', 'Holt Meister Rysons allsehendes Auge aus den Höhlen der Winterax und kehrt damit zu Meister Ryson zurück.$B$BSeid gewarnt, man sagt, dass das allsehende Auge von Meister Ryson einen schrecklicken Fluch mit sich brächte!', 'Euer Kampf im Herzen von Alterac bedeutet dem Syndikat nichts, $C. Wir werden so handeln, wie wir es immer getan haben: Warten, bis sich ein klarer Sieger aus der Asche und dem Geröll des Wahnsinns erhebt, und dann zuschlagen.$B$BAber darum sind wir nicht hier. Das allsehende Auge ging verloren - es wurde von den Winteraxtrollen der Region gestohlen.$B$BBeschafft das Auge wieder und unsere Dienste werden Euch gehören - für die Zeit, die Eurer Seite noch verbleibt.$B$BKehrt zu mir zurück, wenn Ihr das Auge beschafft habt, damit ich es untersuchen kann.$B$B<Meister Ryson grinst.>', 'Meister Rysons allsehendes Auge wurde gefunden', '', '', '', '', 'Kehrt zum Meister des Syndikats Ryson im Alteractal zurück.', 32750),
(57640, 'deDE', 'Meister Rysons allsehendes Auge', 'Holt Meister Rysons allsehendes Auge aus den Höhlen der Winterax und kehrt damit zu Meister Ryson zurück.$B$BSeid gewarnt, man sagt, dass das allsehende Auge von Meister Ryson einen schrecklicken Fluch mit sich brächte!', 'Euer Kampf im Herzen von Alterac bedeutet dem Syndikat nichts, $C. Wir werden so handeln, wie wir es immer getan haben: Warten, bis sich ein klarer Sieger aus der Asche und dem Geröll des Wahnsinns erhebt, und dann zuschlagen.$B$BAber darum sind wir nicht hier. Das allsehende Auge ging verloren - es wurde von den Winteraxtrollen der Region gestohlen.$B$BBeschafft das Auge wieder und unsere Dienste werden Euch gehören - für die Zeit, die Eurer Seite noch verbleibt.$B$BKehrt zu mir zurück, wenn Ihr das Auge beschafft habt, damit ich es untersuchen kann.$B$B<Meister Ryson grinst.>', 'Meister Rysons allsehendes Auge wurde gefunden', '', '', '', '', 'Kehrt zum Meister des Syndikats Ryson im Alteractal zurück.', 32750),
(57639, 'deDE', 'Die Legende von Korrak', 'Der Legende zufolge erscheint der mächtige Anführer der Winteraxtrolle nach gutdünken, um Angst und Schrecken unter den Bewohnen des Alteractals zu verbreiten.$B$BSollte Korrak auftauchen, tötet ihn und kehrt zu Kriegsmeister Laggrond zurück.', 'Die angreifenden Sturmlanzen sind nicht die einzige Bedrohung in dieser Region, Soldat. Der Krieg in diesem Tal tobt an zwei Fronten. Den kannibalistischen Winteraxtrollen dürstet es ebenso nach Macht.$B$BAngeführt werden sie von Korrak dem Blutrünstigen - einem grausamen und verschlagenen Biest.$B$BEin Streich gegen Korrak könnte sich als vernichtender Schlag für den Winteraxklan erweisen. Tötet diesen Bastard und Ihr werdet entlohnt.', '', '', '', '', '', '', 32750),
(57638, 'deDE', 'Korrak der Blutrünstige', 'Der Legende zufolge erscheint der mächtige Anführer der Winteraxtrolle nach gutdünken, um Angst und Schrecken unter den Bewohnen des Alteractals zu verbreiten.$B$BSollte Korrak auftauchen, tötet ihn und kehrt zu Leutnant Haggerdin in Dun Baldar zurück.', 'Die eingeborenen Winteraxtrolle dieser Region sind unbarmherzige Wilde, die nichts lieber täten, als unsere Knochen in einer ihrer widerlichen Mahlzeiten zu sehen.$B$BWir müssen ihnen unsere Macht vor Augen führen!$B$BWir konnten einige Schriftstücke aus ihren Höhlen entwenden, die Aufzeichnungen über ihre Führungshierarchie enthalten. Diese Schriftstücke lassen vermuten, dass ihr Anführer, Korrak der Blutrünstige, sich solange versteckt hält, bis er einen Grund hat sich zu zeigen.$B$BDer Tod Korraks, würde den Tod des Winteraxklans bedeuten! Tötet ihn und kehrt zu mir zurück.', '', '', '', '', '', '', 32750),
(57637, 'deDE', 'Störung entdeckt: Feuerlande', 'Erlebt die Belagerung der Feuerlande erneut.', 'Ihr seid früh dran, $n. Ich hatte noch gar nicht nach Euch geschickt.\n\nEs ist eine weitere Zeitstörung aufgetreten, diesmal in den Feuerlanden. Wenn Ragnaros nicht zum richtigen Zeitpunkt das Handwerk gelegt worden wäre... na ja, Ihr habt ja schon eine Version der Endzeit gesehen.\n\nIch muss ein paar höchst komplexe Zeitverwebungen durchführen, um sicherzustellen, dass Ihr Ragnaros früh genug erwischt, aber doch nach dem Auftreten der Ursache dieser Störung. Wer immer dafür verantwortlich ist, macht keine halben Sachen mehr.', '', '', '', '', '', '', 32750),
(57581, 'deDE', 'Mit viel Federlesen', '', '', '', '', '', '', '', '', 32750),
(57322, 'deDE', 'Vorräte der Eisenschachtmine', 'Bringt 10 Vorräte der Eisenschachtmine zum Rüstmeister der Horde in die Burg Frostwolf.', 'Die Zwerge der Sturmlanzen benutzen die Eisenschachtmine als ein Vorratslager. Ich möchte, dass Ihr diese Mine überfallt und mir ihre Vorräte bringt. Dies sollte die Bemühungen der Sturmlanzen im Alteractal behindern und uns mit der nötigen Ausrüstung versorgen!$B$BSeid vorsichtig, $n. Die Eisenschachtmine liegt tief im Territorium der Allianz, und die Kontrolle über die Mine ändert sich so oft wie neuer Schnee in Alterac fällt.', '', '', '', '', '', '', 32750),
(57321, 'deDE', 'Vorräte der Eisbeißermine', 'Bringt 10 Vorräte der Eisbeißermine zum Rüstmeister der Horde in die Burg Frostwolf.', 'Die Eisbeißermine im Norden war einst ein idealer Ort, um zusätzliche Vorräte zu lagern, aber da die Kämpfe mit den Sturmlanzen nun härter werden, haben wir nicht immer die notwendigen Soldaten über, um sie an der Mine zu positionieren und diese zu bewachen. Daher fällt die Kontrolle über diese Mine oft an die Allianz oder an Untergrundvölker...$B$BAber wir benötigen dennoch unsere Vorräte, $n! Geht zu der Eisbeißermine und bringt mir eine Ladung. Seid wachsam, was unsere Feinde anbelangt, die Übermacht in der Schlacht kann sich an jenem Ort schnell ändern...', '', '', '', '', '', '', 32750),
(57318, 'deDE', 'Mehr Beute!', '', '', '', '', '', '', '', '', 32750),
(57317, 'deDE', 'Beutezug im Feindesland', 'Bringt 20 Rüstungsfetzen zu Schmied Regzar im Dorf der Frostwölfe.', 'Wenn Ihr gegen den Feind kämpft, sammelt die Fetzen seiner Rüstungen ein und bringt sie zu mir. Aus den Fetzen werde ich neue Rüstungen für unsere eigenen Truppen herstellen!', '', '', '', '', '', '', 32750),
(57315, 'deDE', 'Türme und Bunker', 'Erobert einen gegnerischen Turm oder Bunker und kehrt anschließend zu Korporal Teeka Murrblut im Dorf der Frostwölfe zurück.', 'Die Türme und Bunker in diesem Tal sind wichtige Stellungen und daher müssen wir sie möglichst alle erobern und halten! Genug geredet... Erobert einen vom Feind kontrollierten Turm oder Bunker.$B$BBetretet dafür einen mit einem Banner der Allianz. Im Inneren befindet sich ein weiteres Banner. Zieht das Banner heraus und ein weißes Hordenbanner wird an seiner Stelle erscheinen.$B$BDamit habt Ihr meinen Auftrag erfüllt. Wenn Ihr das eroberte Gebäude lange genug haltet, ohne dass die Allianz es zurückgewinnt, gehört es uns!', '', '', '', '', '', '', 32750),
(57314, 'deDE', 'Eine Mine erobern', 'Erobert eine Mine und kehrt zu Korporal Teeka Murrblut im Dorf der Frostwölfe zurück.', 'So wie Kämpfe im Gebiet des Alteractals wüten, so wüten sie auch durch die Eisbeißer- und Eisenschachtminen. Beide bedeuten enorme Ressourcen an Mineralien und beide werden als Lager genutzt; daher ist es kein Wunder, dass sie so heiß begehrt sind!$B$BHelft uns in der Schlacht, $n! Erobert für die Horde eine Mine! Begebt Euch zu einer Mine, die noch nicht von uns kontrolliert wird und tötet den dortigen Anführer! Sobald Ihr das geschafft habt, schicken wir Truppen aus, um die Mine zu bewachen!', '', '', '', '', '', '', 32750),
(57313, 'deDE', 'Sprecht mit unserem Rüstmeister', 'Sprecht mit dem Rüstmeister der Frostwölfe.', '$n, der Rüstmeister der Frostwölfe sucht nach Lehrlingen für Aufgaben, die in die Minen des Alteractals führen. Sprecht mit ihm; er wird Euch mehr berichten.$B$BFolgt der Straße westlich in die Kaserne, dann nehmt den westlichen Ausgang und Ihr findet unseren Rüstmeister.', '', '', '', '', '', '', 32750),
(57312, 'deDE', 'Die Friedhöfe von Alterac', 'Erobert einen Friedhof und kehrt zu Korporal Teeka Murrblut im Dorf der Frostwölfe zurück.', 'Die Frontlinien in diesem Tal sind in ständiger Bewegung. Die Gebietsgrenzen bewegen sich hin und her, während wir unseren Feinden in tödlichen Schlachten gegenüber treten. Doch um die Friedhöfe, $n, wird am grimmigsten gekämpft.$B$BIch möchte, dass Ihr einen von der Allianz besetzten Friedhof angreift! Sucht einen Friedhof mit einem Allianzbanner in seiner Mitte und reißt es aus dem Boden.$B$BWenn Ihr das schafft, ist meine Aufgabe an Euch erfüllt...$B$BSolltet Ihr es außerdem schaffen, den Friedhof für einige Minuten zu halten, wird dieser uns gehören und unsere Truppen werden kommen, um Euch bei der Verteidigung dieser wichtigen Position zu unterstützen.', '', '', '', '', '', '', 32750),
(57311, 'deDE', 'Vorräte der Eisbeißermine', 'Bringt 10 Vorräte der Eisbeißermine zum Rüstmeister der Allianz in Dun Baldar.', 'Die Eisbeißermine ist ein Vorratslager für die Horde. Ich vertrage das Essen nicht, das sie ihren Truppen reichen und der Zustand ihrer Waffen und Rüstungen ist grauenhaft! Aber... in Zeiten wie diesen, in denen Vorräte so wichtig sind, können wir wirklich alles verwenden, was sie haben. $B$BBetretet die Eisbeißermine und bringt mir ihre Vorräte. Dies sollte der Allianz helfen sich weiterhin gut im Kampf zu bewähren und die Soldaten der Horde schwächen.$B$BViel Erfolg, $n. Die Mine ist im entfernten Süden, tief im Territorium der Horde.', '', '', '', '', '', '', 32750),
(57310, 'deDE', 'Vorräte der Eisenschachtmine', 'Bringt 10 Vorräte der Eisenschachtmine zum Rüstmeister der Allianz in Dun Baldar.', 'Bevor die Schlacht begann, lagerten wir Vorräte für Dun Baldar in der Eisenschachtmine. Die Troggs, die dort hausten, waren kein Problem solange wir Ersatztruppen hatten, die die Mine bewachen konnten, aber da wir nun gegen die Horde kämpfen, können wir sie nicht mehr kontrollieren.$B$BWir brauchen die Vorräte in der Eisenschachtmine, $n. Betretet die Mine und bring mir eine Ladung.', '', '', '', '', '', '', 32750),
(57307, 'deDE', 'Türme und Bunker', 'Zerstört das Banner im Inneren eines gegnerischen Bunkers oder Turms. Kehrt anschließend zu Unteroffizier Durgen Sturmlanze in Dun Baldar zurück.', 'Die Türme und Bunker in diesem Tal sind Schlüsselverteidigungspositionen und daher sollten wir so viele wie möglich davon unter Kontrolle halten! Geht und erobert einen vom Feind kontrollierten Turm oder Bunker.$B$BBetretet dafür einen mit einem Hordenbanner. Im Inneren befindet sich ein weiteres Banner. Zieht das Banner heraus und ein weißes Banner der Allianz wird an seiner Stelle erscheinen.$B$BDamit habt Ihr meinen Auftrag erfüllt. Wenn Ihr das eroberte Gebäude lange genug haltet, ohne dass die Horde es zurückgewinnt, gehört es uns!', '', '', '', '', '', '', 32750),
(57306, 'deDE', 'Mehr Rüstungsfetzen', '', '', '', '', '', '', '', '', 32750),
(57305, 'deDE', 'Rüstungsfetzen', 'Bringt Murgot Tiefenschmied in Dun Baldar 20 Rüstungsfetzen.', 'Im Alteractal wird ständig gekämpft und der Nachschub, den wir aus Eisenschmiede bekommen, reicht nicht, um unsere erfahrenen Truppen auszustatten.$B$BWenn Ihr Rüstungsfetzen auf dem Schlachtfeld findet, dann unterstützt unsere Kriegsbemühungen und bringt mir diese Stücke!', '', '', '', '', '', '', 32750),
(57304, 'deDE', 'Eine Mine erobern', 'Erobert eine Mine, die die Sturmlanzen noch nicht kontrollieren, und kehrt dann zu Unteroffizier Durgen Sturmlanze im Alteracgebirge zurück.', 'In den Minen des Alteractals ist noch weit mehr zu finden als bloßes Erz. Sowohl die Frostwölfe als auch die Sturmlanzen haben große Mengen ihrer Ausrüstung in der Eisenschacht- und der Eisbeißermine untergebracht... was eigentlich keine schlechte Idee ist, solange wir die Kontrolle über sie behalten!$B$BBesetzt eine Mine und kehrt zu mir zurück! Um eine Mine zu erobern, betretet eine vom Feind kontrollierte Mine und tötet den dortigen Anführer. Nachdem Ihr das getan habt, gehört die Mine uns und wir werden Truppen zu ihrem Schutz entsenden!', '', '', '', '', '', '', 32750),
(57303, 'deDE', 'Der Rüstmeister', 'Sprecht mit dem Rüstmeister der Sturmlanzen.', '$n, unser Rüstmeister hat mich angewiesen, die neuen Rekruten direkt zu ihm zu schicken. Er benötigt dringend Vorräte aus Kisten, die in den Minen von Alterac eingelagert sind und aller Wahrscheinlichkeit nach wird er Euch entsenden, um sie zu beschaffen.$B$BFolgt einfach der Straße. Ihr findet den Rüstmeister im Westen.', '', '', '', '', '', '', 32750),
(57302, 'deDE', 'Die Friedhöfe im Alteractal', 'Erobert einen Friedhof und kehrt zu Unteroffizier Durgen Sturmlanze in Dun Baldar zurück.', 'Die Friedhöfe im Alteractal sind äußerst wertvolle Gebiete. Beide Seiten, die Horde und die Allianz, kämpfen verbissen um diese geheiligten Stätten. $n, seid Ihr bereit die Kämpfe zu unterstützen?$B$BIch möchte, dass Ihr einen gegnerischen Friedhof besetzt. Sucht einen Friedhof mit einem Hordenbanner in seiner Mitte und reißt es heraus! Wenn Ihr das schafft, ist meine Aufgabe an Euch erfüllt...$B$BSolltet Ihr es schaffen, den Friedhof für einige Minuten zu halten, werden unsere Verstärkungstruppen eintreffen, um Euch bei der Verteidigung zu unterstützen.', '', '', '', '', '', '', 32750),
(57300, 'deDE', 'Zeitsoldat', 'Verdient 500 Ehre in Korraks Rache.', 'Vor langer Zeit war das Land im Alteractal von der Allianz und der Horde hart umkämpft.\n\nNun, eigentlich dauert der Kampf immer noch an, aber lasst uns zusammen anschauen, wie der Konflikt überhaupt erst begann...', '', '', '', '', '', '', 32750),
(57298, 'deDE', 'Was \"wirklich\" passiert ist...', 'Brecht mit Chromie aus den Höhlen der Zeit auf, um Übeltäter der Vergangenheit zu besiegen.', 'Ihr seid über die Jahre weit gekommen, $n.\n\nOb in Euren Anfängen als Mädchen für alles oder später als $gRetter:Retterin; von ganz Azeroth – Ihr habt so viel für die Sicherheit unserer Welt getan.\n\nAber warum sollten wir nur rumstehen und versuchen, uns an alte Zeiten zurückzuerinnern? Reisen wir lieber einfach in der Zeit zurück und erleben die ganzen aufregenden Momente nochmal!\n\nKeine Sorge, es gibt Abermillionen von Zeitwegen. Da finde ich bestimmt einen, in dem Ihr nicht sterbt.', '', '', '', '', '', '', 32750),
(57249, 'deDE', 'Eine zeitige Einladung', 'Bringt die Einladung von den Zeitwanderern zu Chromie in den Höhlen der Zeit.', 'Die Zeit ist gekommen, sich an die Vergangenheit zu erinnern und unsere Abenteuer in Azeroth und darüber hinaus zu feiern. \n\nUm dieses Ereignis zu würdigen, veranstaltet der bronzene Drachenschwarm eine Feier, und Ihr seid eingeladen! \n\nKommt zu den Höhlen der Zeit und zeigt dieses Ticket vor, um eingelassen zu werden!', '', '', '', '', '', '', 32750),
(57198, 'deDE', 'Pflichtgefühl', 'Belauscht Jaina Prachtmeers Treffen.', 'Derek ist frei. Ich habe bei ihm viel gutzumachen.\n\nEs gibt Gerüchte über ein Treffen zwischen Jaina und ihrem Bruder.\n\nReist nach Seebrise im Sturmsangtal. Ich hoffe, dort könnt Ihr herausfinden... na ja, sagen wir, ich versuche das große Ganze im Blick zu behalten.\n\nWenn Ihr etwas interessantes herausfindet, wäre ich Euch sehr dankbar.\n\nDas sollte aber vorerst unter uns bleiben.', '', '', '', '', '', 'Kehrt mit Eurem Bericht zu Lilian Voss zurück.', 32750),
(57152, 'deDE', 'Treu ergeben', 'Sprecht mit Sylvanas Windläufer.', 'Die Dunkle Fürstin hat diesen Ausgang vorhergesehen und dafür einen Notfallplan vorbereitet.\n\nSie will, dass Ihr Euch in die Geisterlande begebt. Benutzt diesen Ruhestein. Er hat noch genug Energie für eine Reise.\n\nSie wird Euch in der Nähe des Windläuferturms treffen.', '', '', '', '', '', '', 32750),
(57151, 'deDE', 'Eine Linie im Sand', 'Sprecht mit Nathanos.', 'In der Stadt haben wir aufgeräumt, jetzt ist es Zeit, den Dreck vor unseren Toren zu tilgen.\n\nWie praktisch, dass diese Verräter sich alle zusammen eingefunden haben, damit wir sie mit einem Schlag auslöschen können.\n\nSetzen wir dieser erbärmlichen Rebellion ein Ende.', '', '', '', '', '', 'Sucht die Dunkle Waldläuferin Lenara in der Nähe von Orgrimmar.', 32750),
(57150, 'deDE', 'Miliz', 'Versammelt die Bewohner von Orgrimmar.', 'Wir haben einen hohen Blutzoll in diesem Krieg gezahlt, unsere Reihen sind gelichtet. Aber die Horde ist immer noch stark. Jeder Bürger von Orgrimmar ist auf dem Schlachtfeld zehn Allianzschwächlinge wert.\n\nRuft die Bürger zusammen und formt eine Miliz! Erinnert sie an ihre getöteten Brüder und Schwestern!', '', '', '', '', '', '', 32750),
(57149, 'deDE', 'Propagandakontrolle', 'Verbrennt die Propaganda der Widerständler in Orgrimmar.', 'Einige Widerständler verteilen Propaganda in der Stadt und verbreiten dreiste Lügen.\n\nWir dürfen uns keine Illusionen machen: Eine Armee von Verrätern und unseren Erzfeinden versammelt sich vor unseren Toren. Wenn es nach diesen Narren geht, würden wir von den Pfeilen der Allianz durchbohrt.\n\n<Nathanos rollt die Augen.>\n\nReißt diesen Mist herunter. Das kann nur Panik auslösen.\n\nUnd solltet Ihr dabei auf... Widerstand stoßen... Ihr seid hiermit bemächtigt, Gewalt einzusetzen.', '', '', '', '', '', '', 32750),
(57148, 'deDE', 'Belagerungsbrecher', 'Platziert heimlich verdächtige Kisten und tötet Wachen.', 'Die Narren, die sich Saurfang angeschlossen haben, fühlen sich mutig genug, einen Frontalangriff zu wagen. Wir dürfen diesem Gewürm nicht erlauben, sich vor unseren Toren zu formieren.\n\nIn diesem Moment bringen unsere Agenten den Pass zwischen Klingenhügel und Orgrimmar zum Einsturz und schneiden Saurfangs Rotte von Verrätern in zwei Hälften.\n\nEure Aufgabe ist es, Euch unter sie zu mischen und ihre Belagerungswaffen zu sabotieren. Legt diese Verkleidung an, aber seid vorsichtig: Sie hält einer näheren Untersuchung nicht stand. Tötet jeden, der droht, Euch zu entlarven.', '', '', '', '', '', '', 32750),
(57147, 'deDE', 'Nicht mein Kriegshäuptling', 'Flieht mit Etrigg und trefft Euch mit Saurfang in Klingenhügel.', 'Es bleibt nicht viel Zeit. Sylvanas weiß, was ich vorhabe und hat daher Euch geschickt, um mich zu töten. Ich bezweifle, dass Eure Entscheidung ihr gefallen wird.\n\nWir müssen schnell zu den Wyvern und uns in die Lüfte erheben.', '', '', '', '', '', '', 32750),
(57130, 'deDE', 'Verräter unter uns', 'Kümmert Euch um diesen Verräter.', 'Es gibt einen Unterschied zwischen Loyalität und blindem Gehorsam. Den Befehlen der Banshee folge ich nie wieder!', '', '', '', '', '', '', 32750),
(57126, 'deDE', 'Glück und Segen...', 'Besucht Derek Prachtmeer und Calia Menethil.', 'Mein Bruder Derek ist im Zweiten Krieg gestorben, nur um dann von der Bansheekönigin gegen seinen Willen wiedererweckt zu werden. Hätte sich Baine Bluthuf dem nicht mutig entgegengestellt, wäre Derek zur Waffe gegen meine Familie geworden.\n\nSeit seiner Wiedererweckung war sein Dasein eine Qual. Ich hatte schon gedacht, dass wir ihn verloren hätten, aber eine alte Freundin, die ebenfalls wiedererweckt wurde, hat ihm geholfen. Das war Calia Menethil. Sie hat ihm einen Weg heraus aus der Verzweiflung gezeigt.\n\nIch bin gerade auf dem Weg, sie zu besuchen. Möchtet Ihr Euch anschließen?', '', '', '', '', '', '', 32750),
(57095, 'deDE', 'Alter Soldat', 'Ehrt Hochfürst Saurfang.', 'Egal, was manche sagen mögen. Er war ein ehrenvoller Orc. Ein Legende. Er war das Ideal, zu dem alle Krieger der Horde aufgesehen haben. \n\nEr hat sein Leben geopfert, um die Kluft in der Horde zu versiegeln, und uns die Chance gegeben, einen neuen Weg einzuschlagen. Sein Tod war mehr als nur der Tod eines Kriegers. Es war der Tod eines Helden.\n\nWir müssen sein Opfer ehren.', '', '', '', '', '', '', 32750),
(57094, 'deDE', 'Der Preis des Sieges', 'Informiert Baine Bluthuf darüber, was geschehen ist.', 'Saurfang... ich...\n\n<Lor\'themar nimmt sich einen Moment, um sich zu sammeln.>\n\n...Thrall wird das Opfer von Saurfang ehren wollen, genau wie der Rest von uns.\n\nRuft unsere Truppen zusammen. Erzählt ihnen, was passiert ist. Erzählt ihnen, dass unser großer Krieger Varok Saurfang tot ist und der Kriegshäuptling uns verlassen hat.\n\nSprecht mit Baine, wenn Ihr in Donnerfels ankommt. Ihr findet ihn auf der Anhöhe der Ältesten. Ich bin mir sicher, er wird Saurfang auch die Ehre erweisen wollen. \n\nLasst uns einmal mehr als vereinte Horde zusammenstehen.', '', '', '', '', '', 'Kehrt zu Lor\'themar vor den Toren von Orgrimmar zurück.', 32750),
(57093, 'deDE', 'Vor den Toren von Orgrimmar', 'Beginnt die Schlacht vor den Toren Orgrimmars.', 'Es ist Zeit.\n\nWir haben uns so gut es geht vorbereitet. Jetzt fehlt nur noch die eigentliche Schlacht.\n\nIch bin kein Freund von Reden, also nur Folgendes:\n\nLok-tar ogar, $n. Sieg. Oder Tod.', '', '', '', '', '', '', 32750),
(57092, 'deDE', 'Strategischer Einsatz', 'Überbringt Saurfangs Einsatzbefehle.', 'Ich habe über Jahre die Tore von Orgrimmar geschützt. Die vielen Zugänge waren schon immer der größte Schwachpunkt der Stadt. Wir sollten sie alle gleichzeitig angreifen, um uns den Sieg zu sichern.\n\nWrynn und ich haben die Einsatzbefehle zusammengestellt. Die Magier werden unsere Flanke decken. Graumähne wird von Westen kommen und die Elfen nehmen den Norden. Mayla wird die Verteidigung in Donnerfels stärken, falls Sylvanas einen Gegenangriff startet.\n\nBringt die Befehle zu den Kommandanten.', '', '', '', '', '', '', 32750),
(57091, 'deDE', 'Bereits unter uns', 'Tötet 10 verdächtige Techniker und Assassinen der Loyalisten.', 'Sylvanas hat immer noch viele treue Gefolgsleute in der Horde. Der Krieg, den sie heraufbeschworen hat, hat viele vor Hass und Wut blind werden lassen. Das nutzt sie für ihre Zwecke aus.\n\n<Saurfang blickt finster.>\n\nSie können nicht sehen, dass sie uns in den Untergang führen wird und dass ihre sogenannten Siege hohle Lügen sind.\n\nEinige ihrer Agenten wurden in unseren Reihen entdeckt. Tötet sie. Sie werden uns keine Gnade erweisen, und wir ihnen auch nicht.', '', '', '', '', '', '', 32750),
(57090, 'deDE', 'Rettung der Belagerung', 'Entfernt $1oa verdächtige Kisten.', 'Im Chaos der Felsstürze haben es die Spione der Banshee geschafft, unsere Wachen zu umgehen. Sie haben Bomben an unseren Belagerungswaffen angebracht.\n\nEntfernt diese Bomben.', '', '', '', '', '', '', 32750),
(57088, 'deDE', 'Nicht meins', 'Beseitigt Felsen, Minen und andere Hindernisse aus dem Pass zwischen Klingenhügel und Orgrimmar.', 'Sylvanas\' Loyalisten haben einen Teil des Pfads durch die Schlucht nach Orgrimmar zum Einsturz gebracht. Unsere Truppen wurden getrennt.\n\nWir müssen unserer Frontlinie verstärken oder die Banshee wird uns nach Belieben ausschalten. Wir sind zu weit gekommen, um einen Tod auf Raten zu sterben.\n\nGazlowe und ein Gnom der Allianz glauben, die Antwort zu haben. Ihr stellt besser sicher, dass ihr Plan nicht nach hinten losgeht.', '', '', '', '', '', '', 32750),
(57002, 'deDE', 'Alter Soldat', 'Sprecht mit Jaina vor den Toren von Orgrimmar.', 'Egal, welche Zweifel er selbst gehabt haben mag, er war ein ehrenvoller Soldat.\n\nEr hat einen Bürgerkrieg innerhalb der Horde verhindert sowie die potenzielle Zerstörung der Allianz. Er hat Sylvanas\' Schreckensherrschaft beendet und dabei sein Leben für viele andere gegeben. \n\nWir werden sein Opfer ehren.', '', '', '', '', '', '', 32750),
(56993, 'deDE', 'Der Preis des Sieges', 'Ruft die Streitkräfte der Allianz zusammen und informiert sie darüber, was geschehen ist.', 'Saurfang... Wie konnte das passieren...\n\n<Jaina nimmt sich einen Moment, um sich zu sammeln.> \n\nDie Allianz kannte Hochfürst Saurfang als bitteren Feind, aber auch als unverzichtbaren Verbündeten.\n\nAnduin wird sein Andenken in Ehren halten. Ruft unsere Truppen zusammen und informiert sie darüber, was geschehen ist. Genns Soldaten wurden am westlichen Tor eingesetzt. Ihr solltet ihn dort antreffen.', '', '', '', '', '', 'Kehrt zu Jaina vor den Toren von Orgrimmar zurück.', 32750),
(56982, 'deDE', 'Vor den Toren von Orgrimmar', 'Beginnt die Schlacht vor den Toren Orgrimmars.', 'Wir haben uns auf diese Schlacht so gut es geht vorbereitet, $p.\n\nIch bete, dass wir alle das Kommende überleben.', '', '', '', '', '', '', 32750),
(56981, 'deDE', 'Strategischer Einsatz', 'Überbringt Anduins Einsatzbefehle.', 'Saurfang meint, der Schlüssel zur Eroberung von Orgrimmar liegt darin, die verschiedenen Zugänge zu nutzen. Er war jahrelang für die Verteidigung der Stadt verantwortlich und kennt ihre verwundbaren Stellen besser als jeder andere. Wir sind sowieso schon knapp an Truppen, aber ich vertraue bei dieser Sache seinem Urteil.\n\nDonnerfels muss ebenfalls verstärkt werden, falls Sylvanas plant, dort anzugreifen, während unsere Streitkräfte hier gebunden sind.\n\nGebt diese Einsatzbefehle an unsere Offiziere weiter. Wir werden alle Tore Orgrimmars gleichzeitig überfallen und parallel Donnerfels verteidigen.', '', '', '', '', '', '', 32750),
(56980, 'deDE', 'Bereits unter uns', 'Tötet 10 verdächtige Techniker und Assassinen der Loyalisten.', 'Obwohl sich einige der Horde unseren Truppen angeschlossen haben, bleiben viele in Orgrimmar Sylvanas treu ergeben. Ihren Saboteuren ist es gelungen, sich unter unsere Leute zu mischen, und sie geben sich als Techniker aus. Ihre Assassinen lauern in den Schatten.\n\nHaltet alle Loyalisten auf, denen Ihr begegnet, bevor sie Schaden anrichten können.', '', '', '', '', '', '', 32750),
(56979, 'deDE', 'Rettung der Belagerung', 'Entfernt $1oa verdächtige Kisten.', 'Im Chaos der Felsstürze haben Sylvanas\' Saboteure es geschafft, unsere Wachen zu umgehen und Bomben an unseren Belagerungswaffen anzubringen.\n\nEinige von ihnen wurden bereits zerstört. Wir können es uns nicht leisten, noch mehr zu verlieren.', '', '', '', '', '', '', 32750),
(56842, 'deDE', 'Mondschutz', 'Führt das Mondritual an den auf der ganzen Welt verstreuten Mondbrunnen durch. Ihr findet sie in Eschental, Teufelswald, Feralas, Mondlichtung, im Steinkrallengebirge, im Dämmerwald und am Hyjal.\n\nWenn Ihr den Segen des Monds verlöschen lasst, müsst Ihr von vorn beginnen.', 'Mein Stab leistet mir schon seit vielen Jahren gute Dienste. Er stand an meiner Seite und hat viele Prüfungen durchgestanden... und während ich älter werde, ertappe ich mich immer öfter dabei, dass ich mich auf ihn stütze.\n\nSeine Blüten blühen bei jedem Mondfest auf und schwelgen in Elunes Macht. Sie machen mir so viel Freude, ich wünschte, sie könnten das ganze Jahr über bleiben. Ich wüsste einen Weg... aber meine Knochen sind zu alt, um die Reise zu überstehen.\n\nVielleicht würdet Ihr die Reise für mich antreten? Ermächtigt meinen Stab im Mondlicht an den Mondbrunnen auf der ganzen Welt. Dann können meine Blüten bleiben.', '', '', '', '', '', 'Kehrt zu Myrael Mondblüte in Mondlichtung zurück.', 32750),
(56833, 'deDE', 'Anführer der Horde', 'Befehlt den Hordeanführern in Orgrimmar, die Schlachtvorbereitungen zu treffen.', 'Saurfang hat sein wahres Gesicht gezeigt und nimmt die Hilfe der Allianz in Anspruch. \n\nTrefft Euch mit jenen, die weiter loyal zur Horde stehen. Sie haben sich auf die Schlacht gegen unsere Feinde vorzubereiten.\n\nUnd was Etrigg angeht... bringt ihn zu Nathanos. Ein schneller Tod ist eine zu milde Strafe für seinen Verrat.\n\nGeht nun, $n. Bringen wir es zu Ende.', '', '', '', '', '', '', 32750),
(56755, 'deDE', 'Rostbolzenrequisition: Moneliterz', 'Bringt $1oa Sturmsilbererz zu Gila Kurzschluss.', '', '', '', '', '', '', '', 32750),
(56754, 'deDE', 'Rostbolzenrequisition: Moneliterz', 'Bringt $1oa Sturmsilbererz zu Skaggit.', '', '', '', '', '', '', '', 32750),
(56746, 'deDE', 'Direktverbindung', 'Baut $1oa Schrottplatztüfteleigegenstände mit Pascal-K1N6.', 'Ihr stimmt mir doch sicher zu, dass Pascal-K1N6 die genialste Erfindung ist, die Ihr je gesehen habt!\n\nWenn Ihr noch nicht überzeugt seid, dann versucht doch mal, ihn an seine Grenzen zu bringen. Nur zu!\n\nBringt ihm mehr Rohstoffe und Baupläne und er wird Euch alles bauen, was Ihr braucht!', '', '', '', '', '', '', 32750),
(56719, 'deDE', 'Nicht meins', 'Beseitigt Felsen, Minen und andere Hindernisse aus dem Pass zwischen Klingenhügel und Orgrimmar.', 'Ihr kommt gerade rechtzeitig, $n. Sylvanas\' Loyalisten haben einen Abschnitt des Pfads durch die Schlucht nach Orgrimmar einstürzen lassen.\n\nWir sind von unserer Vorhut abgeschnitten und ich fürchte, sie wird vernichtet, wenn wir ihr nicht schnell Verstärkung zukommen lassen können. Wir haben nur wenige Truppen. Wir können es uns nicht leisten, dass sie lange festsitzen.\n\nTüftlermeister Oberfunks und Gazlowe glauben, dass sie eine Lösung haben. Beeilt Euch und unterstützt sie auf jede erdenkliche Weise.', '', '', '', '', '', '', 32750),
(56504, 'deDE', 'Furorions Tagebuch', 'Bringt Furorions unvollständiges Tagebuch zu MUTTER.', 'Die Stimmen haben sofort aufgehört, als ich den Trank ausgetrunken habe. Ich danke Euch, $p.\n\nTrotzdem ist es sehr beunruhigend, dass N\'Zoths Einfluss mich sogar in der Herzkammer erreicht hat. Wenn Furorion einen Weg gefunden hat, den Alten Göttern zu widerstehen, dann können wir das nutzen, um die Verteidigungsmechanismen der Kammer zu verstärken.\n\nVielleicht kann MUTTER mehr Informationen aus Furorions Tagebuch gewinnen.', '', '', '', '', '', '', 32750),
(56496, 'deDE', 'Der Abend vor der Schlacht', 'Sprecht mit Lor\'themar.', '$n, wir müssen über die Horde sprechen... und den Kriegshäuptling.\n\nDer Krieg ist uns teuer zu stehen gekommen und die Schlacht gegen Azshara hat die wenigen Ressourcen, die uns noch zur Verfügung standen, aufgezehrt. Die Horde ist wieder einmal gespalten und der Allianz geht es kaum besser als uns. \n\nSylvanas ist jetzt in der Position, alle zu vernichten, die sie als Feinde betrachtet. Das schließt uns mit ein.\n\nIch hatte gehofft, dass meine alte Freundin zur Vernunft kommen würde, aber jetzt...\n\nHochfürst Saurfang schart alle um sich, die von uns noch übrig sind... und einige unwahrscheinliche Verbündete.', '', '', '', '', '', 'Sprecht mit Varok Saurfang in Klingenhügel.', 32750),
(56495, 'deDE', 'Sie ziehen gegen uns zu Felde', 'Trefft Euch mit Sylvanas in Orgrimmar.', 'Die Dunkle Fürstin hat um Eure Anwesenheit in Orgrimmar gebeten, $n.\n\nDie Ratten trauen sich endlich aus der Deckung. Das macht es leichter für uns, sie zu zerquetschen.\n\nBeeilt Euch. Auf diesen Moment haben wir lange genug gewartet.', '', '', '', '', '', '', 32750),
(56494, 'deDE', 'Der Abend vor der Schlacht', 'Sprecht mit Mathias Shaw.', '$n. Die Zeit ist gekommen.\n\nWir mögen Azshara besiegt haben, aber wir müssen uns immer noch mit Sylvanas auseinandersetzen. Obwohl unsere Position nicht ideal ist, haben wir unsere verfügbaren Truppen mobilisiert und stehen bereit, um diesen Krieg zu beenden.\n\nKönig Wrynn wollte, dass ich Euch über die Lage ins Bild setze, bevor wir uns ihm anschließen. Es gab einige... interessante Entwicklungen.', '', '', '', '', '', 'Sprecht mit Anduin Wrynn in Klingenhügel.', 32750),
(56475, 'deDE', 'Gewundenes Yetihorn', 'Bringt das gewundene Yetihorn zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 'Alle möglichen Kreaturen werden von dem süßen Geruch des frischen Honigs angelockt, aber nur recht wenige sind bereit, die schmerzhaften und oft tödliche Stiche der größten Bienen auszuhalten. Dieser Yeti ist dem Stock allerdings ein ständiger Dorn im Auge gewesen... bis jetzt.\n\nDie Schwarmmutter wird sich für diesen Gegenstand interessieren.', '', '', '', '', '', 'Bringt das gewundene Yetihorn zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 32750),
(56474, 'deDE', 'Stachel der Schwarmtöterin', 'Bringt den Stachel der Schwarmtöterin zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 'Wespen sind natürliche Feinde der Bienen und es gibt keine tödlicheren als diese hochspezialisierten Killer. Diese Wespe wird den Stock nie wieder terrorisieren, und das ist Euch zu verdanken.\n\nDie Schwarmmutter wird sich für diesen Gegenstand interessieren.', '', '', '', '', '', 'Bringt den Stachel der Schwarmtöterin zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 32750),
(56473, 'deDE', 'Giftüberzogener Spinnenfangzahn', 'Bringt den giftüberzogenen Spinnenfangzahn zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 'Sogar vorsichtige Bienen sind diesen gewaltigen Spinnen zum Opfer gefallen. Die Spinnen liegen in der Nähe von Blumenbeeten auf der Lauer und überfallen die sammelnden Bienen hinterrücks. Dank Euch müssen sie sich nun über eine Spinne weniger den Kopf zerbrechen.\n\nDie Schwarmmutter wird sich für diesen Gegenstand interessieren.', '', '', '', '', '', 'Bringt den giftüberzogenen Spinnenfangzahn zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 32750),
(56390, 'deDE', 'Voltschlinger', '', '', '', '', '', '', '', '', 32750),
(56389, 'deDE', 'Tangstein', '', '', '', '', '', '', '', '', 32750),
(56388, 'deDE', 'Gedankenknechter', '', '', '', '', '', '', '', '', 32750),
(56386, 'deDE', 'Brutälteste von Nalaada', '', '', '', '', '', '', '', '', 32750),
(56385, 'deDE', 'Perlenschalenkrabbler', '', '', '', '', '', '', '', '', 32750),
(56267, 'deDE', 'Geflüster von N\'Zoth', 'Sprecht mit Kalecgos in der Herzkammer.', 'Wir haben einen Notfall, Champion! Wir brauchen Euch sofort in der Herzkammer.\n\nIrgendetwas Bösartiges bohrt sich in Ebenhorns Geist. Er kann es nicht abschütteln!\n\nVielleicht könnt Ihr ihm helfen!', '', '', '', '', '', 'Sprecht mit Kalecgos in der Herzkammer.', 32750),
(56266, 'deDE', 'Mgglurkys Mugglrgl', 'Holt Mgglurkys Mugglrgl aus dem Blutflossendorf zurück.', 'Mein Koch Mgglurky hat sein Mugglrgl verloren und weigert sich, zu arbeiten, ehe er es nicht zurückbekommt.\n\nIch habe einen Tresen voll mit hungrigen Murlocs und solange Mgglurky nicht kocht, habe ich nichts, um sie zu beköstigen. Wenn Mgglurky nicht bald sein Mugglrgl findet, haben wir hier einen Aufstand am Hals!\n\nIch weiß ja nicht, wie es Euch geht, aber ich habe keine Lust, heute Abend das Hauptgericht zu sein.\n\nHier haben vorhin einige Blutflossen herumgelungert. Durchsucht das Blutflossendorf nach dem Mugglrgl und bringt es mir, wenn Ihr es gefunden habt.', '', '', '', '', '', '', 32750),
(56190, 'deDE', 'Rettet Ebenhorn', 'Kehrt zur Herzkammer zurück und behandelt Ebenhorn mit dem Trank der geistigen Klarheit.', '<Der Trank wirkt mächtig und chaotisch. Er verändert scheinbar zufällig seine Farbe.\n\nDas muss das Gebräu sein, über das Furorion geschrieben hat. Es genügt, nur in seiner Nähe zu stehen, und Ihr bekommt einen klareren Kopf.\n\nIhr habt zwar nicht den Schwarzen Prinzen selbst gefunden, aber vielleicht hilft das, was er Euch hinterlassen hat, Ebenhorn.>', '', '', '', '', '', '', 32750),
(56189, 'deDE', 'Dem Schwarzen Prinzen auf der Spur', 'Betretet die Katakomben von Karazhan und sucht nach einem Heilmittel für Ebenhorn.', '<Es sieht so aus, als ob hier ein Kampf stattgefunden hätte. N\'Zoths Agenten sind wohl bereits in die Katakomben unter Karazhan eingedrungen.\n\nDer tote Späher hatte einen Satz Schlüssel dabei. Vielleicht gewähren sie Euch Zugang.\n\nMit etwas Glück könnt Ihr Furorion vor N\'Zoths Agenten finden und etwas in Euren Besitz bringen, was Ebenhorn helfen könnte.>', '', '', '', '', '', '', 32750),
(56188, 'deDE', 'Zu den Katakomben!', 'Sucht Furorion vor den Katakomben von Karazhan.', 'Ich habe durchgehalten, so lange es ging, aber... die Stimmen waren zu mächtig. \n\nIhr müsst Euch schnellstmöglich nach Karazhan begeben. Der Schwarze Prinz sagte, er wollte die Artefakte studieren, die dort in den Katakomben aufbewahrt sind.\n\nBitte, lasst nicht zu, dass mein Versagen seinen Untergang bedeutet!', '', '', '', '', '', 'Sucht Furorion vor den Katakomben von Karazhan.', 32750),
(56187, 'deDE', 'Pechschwingenschatten', 'Sucht Furorion am Eingang zum Pechschwingenabstieg.', 'Offensichtlich ist der Schwarze Prinz nicht hier. Glaubt mir ruhig, wenn ich Euch sage, dass er nicht so einfach zu finden ist.\n\nIch würde an Eurer Stelle zum Schwarzfels aufbrechen. An der Stelle, wo Nefarian einst seinen Unterschlupf hatte, ist dort eine Art Terrasse in den Hang gemeißelt.\n\nFurorion hat diesen Ort lange Zeit beobachtet. Auch, wenn er sich selbst nicht dort aufhält, trefft Ihr vielleicht jemanden, der weiß, wo Ihr suchen müsst.\n\nNoch ein Rat, $C... Es ist offensichtlich, dass nicht nur Ihr nach ihm sucht. Passt auf Euch auf.', '', '', '', '', '', '', 32750),
(56186, 'deDE', 'Überall Spione', 'Sucht Furorion in der Taverne im Nebel.', 'Ebenhorn kann den Stimmen nicht ewig standhalten. Die dunklen Mächte, die einst den schwarzen Drachenschwarm verderbt haben, wollen die Welt wieder überwältigen.\n\nWir müssen uns irgendwie zur Wehr setzen. Ich erwähne ihn nur äußerst ungern, aber ich weiß von jemandem, der die Alten Götter studiert hat, um ihrer perfiden Macht zu trotzen: Furorion.\n\nDer Schwarze Prinz wird nicht einfach zu finden sein. Er hat Verbündete in Pandaria in der Taverne im Nebel an der Verhüllten Treppe. Ich schlage vor, Ihr beginnt Eure Suche dort.\n\nBitte beeilt Euch, $p.', '', '', '', '', '', '', 32750),
(56185, 'deDE', 'Geflüster von N\'Zoth', 'Sprecht mit Kalecgos in der Herzkammer.', 'Wir haben einen Notfall, Champion! Wir brauchen Euch sofort in der Herzkammer.\n\nIrgendetwas Bösartiges bohrt sich in Ebenhorns Geist. Er kann es nicht abschütteln!\n\nVielleicht könnt Ihr ihm helfen!', '', '', '', '', '', 'Sprecht mit Kalecgos in der Herzkammer.', 32750),
(56144, 'deDE', 'Tatze der alten Nasha', 'Bringt die Tatze der alten Nasha zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 'Die Tatze der alten Bärin ist klebrig vom Honig. Wahrscheinlich hat sie einige Stöcke geplündert, bevor Ihr sie aufgehalten habt.\n\nDie Schwarmmutter wird sich für diesen Gegenstand interessieren.', '', '', '', '', '', 'Bringt die Tatze der alten Nasha zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 32750),
(56092, 'deDE', 'Geléevorrat des Schwarmdiebs', 'Bringt den Geléevorrat des Schwarmdiebs zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 'Dieser Ettin war ein bekanntes und oft gefürchtetes Gesicht unter den Bienen des Honigrückenschwarms. Ihre Geléespeicher werden von seinem Ableben profitieren.\n\nDie Schwarmmutter wird sich für diesen Gegenstand interessieren.', '', '', '', '', '', 'Bringt den Geléevorrat des Schwarmdiebs zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 32750),
(56091, 'deDE', 'Duftdrüse der Usurpatorin', 'Bringt die Duftdrüse der Usurpatorin zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 'Wenn eine neue Königin geboren wird und alt genug ist, um ihren eigenen Schwarm zu gründen, verlässt sie den Stock. Ihr Geruch zieht einige Schwarmangehörige an, die dann mit ihr in ihre neue Heimat fliegen. Diese hier hat dank Euch wahrscheinlich nie die Chance dazu erhalten.\n\nDie Schwarmmutter wird sich für diesen Gegenstand interessieren.', '', '', '', '', '', 'Bringt die Duftdrüse der Usurpatorin zur Honigrückenschwarmmutter, um eine Belohnung zu erhalten.', 32750),
(56081, 'deDE', 'Okto-Griff', '', '', '', '', '', '', '', '', 32750),
(56018, 'deDE', 'Runenverriegelte Truhe', '', '', '', '', '', '', '', '', 32750),
(56014, 'deDE', 'Runenverriegelte Truhe', '', '', '', '', '', '', '', '', 32750),
