(55527, 'deDE', 'Bringt es ihm...', 'Bringt Mrrl 3 Geisteressen, 3 gesunde Murlocmahlzeiten und 3 Meeresriesenfußdreck.', '<Mrrl zeigt auf Euren Rucksack und malt dann etwas in den Sand. Er holt einen schönen Gegenstand hinter einem Felsen hervor, zeigt dann wild fuchtelnd auf sich selbst, dann zu Euch und dann auf Eure Tasche.\n\nIhr glaubt, er möchte einen Tausch vorschlagen.>', '', '', '', '', '', '', 32750),
