(54052, 'deDE', 'Questfall', 'Tötet $2oa Gnolle der Flusspfoten und besiegt Bellpranke.', 'Ich entschuldige mich, Kumpel! Neu am Bogen! Hab eher einen Schwertarm, was?!\n\nWollte Euch nicht so erschrecken! Es ist nur, dass wir hier etwas in der Klemme stecken, meine Wenigkeit und die Besatzung hier!\n\nKönnt Ihr uns etwas helfen?! Ein paar aufrecht laufende Hunde haben uns mitten in der Nacht angegriffen! Haben uns in Unterwäsche aus dem Lager gejagt!\n\nVielleicht könnt Ihr helfen? Der Boss war etwas größer als die anderen! Wir haben ihn Bellpranke genannt, weil er uns angebellt hat und Riesenpranken hatte!', '', '', '', '', '', '', 32750),
(53983, 'deDE', 'Nasse Sache: Fortneid', '', '', '', '', '', '', '', '', 32750),
(53977, 'deDE', 'Die Kriegskasse', 'Beschafft Ressourcen aus der Kriegskasse in Bashal\'Aran.', 'Willkommen an der Kriegsfront, $n! Endlich geht es zur Sache. \n\nAlle Ressourcen, die wir zusammengetragen haben, kommen in die Kriegskasse. Sobald sich dort genug angesammelt hat, könnt Ihr Euch bedienen!\n\nWieso schaut Ihr nicht mal vorbei und seht, was Ihr findet?', '', '', '', '', '', '', 32750),
(53974, 'deDE', 'Druiden vom Düsterseestrand', 'Nehmt den Düsterseestrand ein und sprecht dann mit Edgard, um herauszufinden, was er zu bieten hat.', 'Die latente Macht am Düsterseestrand bietet uns die Möglichkeit, uns große Macht nutzbar zu machen. Edgard, einer unserer Verbündeten, verfügt über umfangreiches Wissen darüber, welche Auswirkungen das auf unsere Bemühungen haben könnte.\n\nSucht ihn auf und entdeckt die Macht der Natur.', '', '', '', '', '', '', 32750),
(53961, 'deDE', 'Glevenwerk, Meisterwerk', 'Sprecht mit Erion und erfahrt, was das Glevenwerk zu bieten hat.', 'Wir alle sind seit Teldrassil etwas angespannt, aber Erion hat es besonders schwer getroffen. Er hat die erste Chance zu helfen mit beiden Händen ergriffen.\n\nWieso sprecht Ihr nicht mit ihm und findet heraus, was er da im Glevenwerk auf die Beine stellt?', '', '', '', '', '', '', 32750),
(53960, 'deDE', 'Der Altar der Alten', 'Sprecht mit Mondpriesterin Lasara und lasst Euch erklären, was der Altar der Alten zu bieten hat.', 'Jetzt, da die Spenden in vollem Gange sind, wurde der Altar der Alten wiedererrichtet.\n\nGeht und sprecht mit Mondpriesterin Lasara und lasst Euch erklären, was der Altar zu bieten hat.', '', '', '', '', '', '', 32750),
(53959, 'deDE', 'Aufgerüstete Armee', 'Sprecht mit Cordressa Dornenbogen, um zu erfahren, was die Jägerhalle zu bieten hat.', 'Wir müssen sicherstellen, dass unsere Soldaten die bestmögliche Ausrüstung im Kampf gegen die Horde zur Verfügung haben.\n\nSobald die Jägerhalle fertig ist, sprecht mit Cordressa Dornenbogen darüber, wie die Waffen und Rüstungen unserer Trupps verbessert werden können.', '', '', '', '', '', '', 32750),
