(52257, 'deDE', 'Felsenwelt', 'Schließt Euch den Urtumen an, um die Feinde der Horde zu töten.', 'Wir kämpfen nicht allein, $n.\n\nHeute werden die Urtume Euch auf ihren Ästen tragen. Gebt alles, um unsere Wälder zu verteidigen!', '', '', '', '', '', '', 32750),
