(50384, 'deDE', 'Doug Test - Completable Quest4', 'Sprecht mit Baron Zobelmähne im Zirkel des Blutes im Schergrat.', '$n, während Ihr denen da draußen richtig die Hölle heiß gemacht habt, hat Baron Zobelmähne seinen Drachen mit einer Nachricht hierher geschickt.$B$BEr hat nach Euch persönlich gefragt. So wie ich es verstanden habe, möchte er, dass Ihr seinen eigenen Kampf gegen die Gronn weiterführt.$B$BIch schätze, dass Ihr wohl die geeignetste Person in der ganzen Scherbenwelt seid, um ihm dabei zu helfen, aber an Eurer Stelle würde ich ein paar Freunde bitten, Euch zum Zirkel des Blutes zu begleiten.', '', '', '', '', '', '', 32750),
