(30042, 'deDE', 'Viel zu lernen', 'Sprecht mit Meister Shang Xi.', 'Nun, da Eure Ausbildung begonnen hat, erhaltet Ihr Eure erste, recht simple Aufgabe: Sprecht mit Meister Shang Xi.', '', '', '', '', '', '', 32750),
(9025, 'deDE', 'Morgans Entdeckung', 'Kehrt zu Aristan Mottar zurück, er befindet sich vor der Bank im Handelsdistrikt von Sturmwind.', 'Nun... es sieht ganz so aus, als ob Aristan doch noch auf etwas gestoßen sein könnte. Ich habe Spuren von Substanzen gefunden, die in Liebestränken und Gedanken verwirrenden Gebräuen verwendet werden.$b$bEs ist nicht ungewöhnlich, dass man in Parfüm derartige Spuren auffindet, allerdings sind einige der Zutaten, die ich in den Düften finden konnte, doch recht... merkwürdig.', '', '', '', '', '', '', 32750),
(4967, 'deDE', 'Wissen der Kugel von Orahil', 'Sprecht mit Menara Leerbringer im Brachland.', 'Immer noch derselbe Dummkopf... und immer noch auf der Suche nach Dingen der Sterblichen. Ja, es mag Euch arrogant erscheinen, wie ich zu Euch spreche. Ihr steht vor mir und ich muss lachen. Ihr seid jämmerlich!$B$BAber was ich denke, zählt nicht. Es zählt nur, was jene denken, die gewillt sind, sich mit Euch abzugeben! Und obwohl ich anderer Ansicht bin, sind jene, die über ein gewisses Maß an Macht gebieten, der Meinung, dass Ihr mehr verdient.$B$BWenn es das ist, wonach Ihr trachtet, solltet Ihr mit Menara Leerbringer im Turm oberhalb von Ratschet sprechen. Ich glaube, Ihr habt sie vor geraumer Zeit schon einmal getroffen.', '', '', '', '', '', '', 32750),
(4782, 'deDE', 'Komponenten für die verzauberte Goldblutrobe', 'Kehrt zu Menara Leerbringer im Brachland zurück.', 'Kehrt zu Menara zurück und sagt Ihr, dass es eine Weile dauern wird, aber ich werde auf jeden Fall auf sie... und Euch zurückkommen. Sagt Ihr, dass Ihr zunächst noch die restlichen Komponenten zusammentragen müsst - bis dahin sollte ich das Garn fertig haben. Ihr könnt dann wieder herkommen und es mitnehmen.$B$BViel Glück, $n. Oh, und grüßt Strahad von mir, wenn Ihr schon mal dort seid. Der alte Zausel... hat doch wirklich kaum einen Steinwurf von Ratschet einen Turm errichtet... verrückt.', '', '', '', '', '', '', 32750),
(3086, 'deDE', 'Glyphenschrifttafel', 'Lest die mit Glyphen versehene Schrifttafel und sprecht mit Mai\'ah beim Eingang zum Höhlenbau im Tal der Prüfungen.', 'Ah, während Ihr fort wart, kam eine Schrifttafel für Euch, $n.$B$BLest sie, wenn Ihr Zeit habt. Wenn ich mich nicht irre, kam sie von der Magierlehrerin Mai\'ah. Sie würde gern mit Euch sprechen, wenn Ihr bereit seid.', '', '', '', '', '', '', 32750),
(2996, 'deDE', 'Die Suche nach Strahad', 'Sprecht mit Strahad Farsan in Ratschet.', 'Ich habe Euch in der Vergangenheit viele Fertigkeiten beigebracht, aber es ist an der Zeit, dass Euch ein anderer lehrt. Er lebt in Ratschet und sein Name ist Strahad. Er ist ein Mensch, aber lasst Euch deswegen nicht dazu hinreißen, ihn für schwach zu halten. Er mag klein sein, aber er ist auch mächtig. Er kann Euch mächtigere Beschwörungen lehren - ich fühle, dass Ihr dazu bereit seid. Geht nun zu ihm. Er ist in Ratschet... Über der Hafenstadt gleich bei seinem Turm.', '', '', '', '', '', '', 32750),
(2359, 'deDE', 'Klavens Turm', 'Stehlt den Turmschlüssel der Defias, brecht in den Turm der Defias ein und stellt fest, was sich in der Dämmerwaldtruhe befindet. Bringt Mathias Shaw in Sturmwind dann alle Informationen über das, was Ihr herausgefunden habt. Lest Kearnens Tagebuch, um neue Erkenntnisse über den Turm zu erlangen.', 'Ich überwache diesen Turm jetzt schon seit Wochen, $n. Kürzlich kam eine größere Lieferung aus dem Dämmerwald an und mit dieser Lieferung kamen auch diese Wachen.$B$BWas sie sind? Das weiß ich genauso wenig wie Ihr. Eines kann ich Euch aber sagen: Menschen sind das nicht.$B$BWie dem auch sei, bei der Lieferung war eine Truhe dabei und ich vermute mal, das ist es, was diese Monstrositäten bewachen. Die Kreatur mit den Stacheln hat einen Schlüssel, den wir brauchen.$B$BBeschafft Euch den Schlüssel, dringt in den Turm ein und stellt fest, was in dieser Truhe ist. Berichtet dann Mathias, was Ihr herausgefunden habt.', '', '', '', '', '', '', 32750),
(1686, 'deDE', 'Eluras Schemen', 'Bringt 8 Ladungen Eluniterz und das Medaillon von Elura zu Elanaria in Darnassus.', 'Ihr habt viel gelernt, $n. Jetzt fertigen wir Euch eine Waffe an. Die Waffe eines Kriegers.$B$BDazu müsst Ihr nach Dunkelküste reisen.$B$BVor langer Zeit zerschellte ein Schiff auf den Felsen beim Leuchtturm von Auberdine. Viele Kisten Eluniterz sanken auf den Meeresgrund.$B$BAls Erstes müsst Ihr den Wächter des Elunits besiegen, Eluras Schemen. Sie war einst Kapitän des Schiffes und verfluchte sich selbst dazu, für alle Zeiten in der Tiefe zu verweilen und ihre Schiffsladung zu schützen. Besiegt sie, nehmt Ihr das Medaillon ab und sammelt die verlorenen Elunitkisten ein.', '', '', '', '', '', '', 32750),
(1152, 'deDE', 'Test der Lehre', 'Sucht Braug Dämmergeist in der Nähe des Eingangs zum Steinkrallenpfad im Steinkrallengebirge.', 'Eure Zeit bei mir neigt sich dem Ende zu. Ich bin wissend, aber den Test der Lehre kann ich Euch nicht stellen. Es gilt, Lektionen zu erlernen und Orte zu besuchen, die in der Zuständigkeit anderer liegen.$B$BWenn Ihr bereit seid, dann sucht Braug Dämmergeist auf - er ist ein höchst weiser Schamane. Er wird Euch weiter testen, also achtet auf seine Worte, $n.$B$BWenn Ihr bereit seid, dann sucht den Tunnel, der das Steinkrallengebirge mit dem Eschental verbindet. Dort in der Nähe lebt Braug. Und seid vorsichtig, $n, die Nachtelfen versuchen vielleicht, Euren Test zu behindern.', '', '', '', '', '', '', 32750),
(1027, 'deDE', 'Sich tot stellen', 'Erhaltet das letzte Teil von Dartols Rute, den Eisenschwertknauf.', 'Das letzte Stück der Rute ist im Besitz der Druiden der Klaue. Ich habe ihren Anführer, Oso Dornennarbe, gebeten, es mir auszuhändigen, aber er und seine Wächter hätten mich beinahe umgebracht! Offenbar hat die Verderbnis des Herzens des Waldes seitens der Horde auch die Druiden betroffen.$B$BAber ich habe eine Idee, wie Ihr in Osos Höhle gelangen und den Knauf an Euch nehmen könnt.$B$BSchon als kleiner Faun war ich immer ziemlich gut darin, mich tot zu stellen. Das funktioniert wunderbar gegen Bären! Ich kann es Euch beibringen! Geht nach Osten zum Schattenwinkel und wenn sie versuchen, Euch anzugreifen, probiert einfach meine Taktik aus.', '', '', '', '', '', '', 32750);
